import Header from "../modules/Header";
import React, {useContext} from 'react';
import { MovieContext } from "../App";

const Movies = () => {
  const movies = useContext(MovieContext);

  const generateMovies = () => {
    console.log(movies.results)
  }


  return (
    <div>
      <Header/>
      <div>
        {generateMovies}
      </div>
    </div>
  )
}

export default Movies;
